(5373, 'UserAgreement', 'tr', 'Kullanıcı Sözleşmesi', '2025-07-21 16:19:59.946114'),
(5374, 'UserAgreement', 'en', 'User Agreement', '2025-07-21 16:19:59.946114'),
(5375, 'UserAgreement', 'de', 'Nutzervertrag', '2025-07-21 16:19:59.946114'),
(5376, 'UserAgreementSection1Title', 'tr', '1. Taraf ve Hizmet Tanımı', '2025-07-21 16:19:59.946114'),
(5377, 'UserAgreementSection1Title', 'en', '1. Parties and Service Description', '2025-07-21 16:19:59.946114'),
(5378, 'UserAgreementSection1Title', 'de', '1. Parteien und Dienstbeschreibung', '2025-07-21 16:19:59.946114'),
(5379, 'UserAgreementSection1Text', 'tr', '[İlteris-G], iş sağlığı ve güvenliği (OSGB) süreçlerini yöneten işverenler, işyeri hekimleri, İSG uzmanları ve diğer sağlık personeli için bir hizmet sunmaktadır. Kullanıcılar, kayıt sırasında bireysel veya kurumsal olarak hesap açabilir ve ilgili rollerine uygun hizmetlerden faydalanabilir.', '2025-07-21 16:19:59.946114'),
(5380, 'UserAgreementSection1Text', 'en', '[İlteris-G] provides a service for employers, workplace doctors, OHS specialists, and other health personnel managing occupational health and safety (OSGB) processes. Users can create individual or corporate accounts during registration and benefit from services suitable for their roles.', '2025-07-21 16:19:59.946114'),
(5381, 'UserAgreementSection1Text', 'de', '[İlteris-G] bietet einen Dienst für Arbeitgeber, Betriebsärzte, Arbeitsschutzspezialisten und anderes Gesundheitspersonal, die Prozesse für Arbeitsschutz und Gesundheit (OSGB) verwalten. Nutzer können während der Registrierung individuelle oder Unternehmenskonten erstellen und von den für ihre Rollen geeigneten Diensten profitieren.', '2025-07-21 16:19:59.946114'),
(5382, 'UserAgreementSection2Title', 'tr', '2. Kullanıcı Hesapları ve Güvenlik', '2025-07-21 16:19:59.946114'),
(5383, 'UserAgreementSection2Title', 'en', '2. User Accounts and Security', '2025-07-21 16:19:59.946114'),
(5384, 'UserAgreementSection2Title', 'de', '2. Benutzerkonten und Sicherheit', '2025-07-21 16:19:59.946114'),
(5385, 'UserAgreementSection2Text', 'tr', 'Kullanıcı, hesap oluştururken doğru, eksiksiz ve güncel bilgiler sağlamakla yükümlüdür. Kullanıcı adı ve şifresinin güvenliği tamamen kullanıcının sorumluluğundadır. Üçüncü şahısların hesap bilgilerine erişmesi durumunda oluşacak zararlardan Platform sorumlu değildir.', '2025-07-21 16:19:59.946114'),
(5386, 'UserAgreementSection2Text', 'en', 'The user is responsible for providing accurate, complete, and up-to-date information during account creation. The security of the username and password is entirely the user’s responsibility. The Platform is not liable for damages resulting from third-party access to account information.', '2025-07-21 16:19:59.946114'),
(5387, 'UserAgreementSection2Text', 'de', 'Der Nutzer ist verpflichtet, bei der Kontoerstellung genaue, vollständige und aktuelle Informationen bereitzustellen. Die Sicherheit von Benutzername und Passwort liegt vollständig in der Verantwortung des Nutzers. Die Plattform haftet nicht für Schäden, die durch den Zugriff Dritter auf Kontoinformationen entstehen.', '2025-07-21 16:19:59.946114'),
(5388, 'UserAgreementSection3Title', 'tr', '3. Hizmet Kullanım Koşulları', '2025-07-21 16:19:59.946114'),
(5389, 'UserAgreementSection3Title', 'en', '3. Service Usage Conditions', '2025-07-21 16:19:59.946114'),
(5390, 'UserAgreementSection3Title', 'de', '3. Nutzungsbedingungen des Dienstes', '2025-07-21 16:19:59.946114'),
(5391, 'UserAgreementSection3Text', 'tr', 'Kullanıcılar Türk Ceza Kanunu, Fikir ve Sanat Eserleri Kanunu ve ilgili diğer yasalara uygun hareket etmekle yükümlüdür. Kullanıcılar, hileli, yanıltıcı, yasa dışı içerik paylaşamaz veya hizmeti kötüye kullanamaz. Hizmetlerin kesintisiz veya hatasız çalışacağı garanti edilmemektedir.', '2025-07-21 16:19:59.946114'),
(5392, 'UserAgreementSection3Text', 'en', 'Users are obliged to comply with the Turkish Penal Code, the Law on Intellectual and Artistic Works, and other relevant laws. Users may not share fraudulent, misleading, or illegal content or misuse the service. It is not guaranteed that the services will operate uninterrupted or error-free.', '2025-07-21 16:19:59.946114'),
(5393, 'UserAgreementSection3Text', 'de', 'Nutzer sind verpflichtet, das türkische Strafgesetzbuch, das Gesetz über geistige und künstlerische Werke und andere relevante Gesetze einzuhalten. Nutzer dürfen keine betrügerischen, irreführenden oder illegalen Inhalte teilen oder den Dienst missbrauchen. Es wird nicht garantiert, dass die Dienste ununterbrochen oder fehlerfrei funktionieren.', '2025-07-21 16:19:59.946114'),
(5394, 'UserAgreementSection4Title', 'tr', '4. Kişisel Verilerin Korunması ve KVKK', '2025-07-21 16:19:59.946114'),
(5395, 'UserAgreementSection4Title', 'en', '4. Personal Data Protection and GDPR', '2025-07-21 16:19:59.946114'),
(5396, 'UserAgreementSection4Title', 'de', '4. Schutz personenbezogener Daten und DSGVO', '2025-07-21 16:19:59.946114'),
(5397, 'UserAgreementSection4Text', 'tr', 'Platform, 6698 sayılı Kişisel Verilerin Korunması Kanunu (\"KVKK\") kapsamında kullanıcıların kişisel verilerini işleyecektir. Kullanıcılar, kişisel verilerinin kimlik doğrulama, yetkilendirme ve platform hizmetlerinden faydalanma amacıyla işlendiğini kabul eder.', '2025-07-21 16:19:59.946114'),
(5398, 'UserAgreementSection4Text', 'en', 'The Platform will process users’ personal data in accordance with Law No. 6698 on the Protection of Personal Data (\"KVKK\"). Users accept that their personal data is processed for identity verification, authorization, and platform service purposes.', '2025-07-21 16:19:59.946114'),
(5399, 'UserAgreementSection4Text', 'de', 'Die Plattform verarbeitet personenbezogene Daten der Nutzer gemäß dem Gesetz Nr. 6698 zum Schutz personenbezogener Daten (\"KVKK\"). Nutzer akzeptieren, dass ihre personenbezogenen Daten für Identitätsprüfung, Autorisierung und Plattformdienstzwecke verarbeitet werden.', '2025-07-21 16:19:59.946114'),
(5400, 'UserAgreementSection5Title', 'tr', '5. Üçüncü Taraf Hizmetleri', '2025-07-21 16:19:59.946114'),
(5401, 'UserAgreementSection5Title', 'en', '5. Third-Party Services', '2025-07-21 16:19:59.946114'),
(5402, 'UserAgreementSection5Title', 'de', '5. Dienste Dritter', '2025-07-21 16:19:59.946114'),
(5403, 'UserAgreementSection5Text', 'tr', 'Kullanıcılar, platform üzerinden üçüncü taraf hizmetlerine yönlendirilebilir. Platform, üçüncü taraf hizmet sağlayıcıların eylemlerinden sorumlu değildir.', '2025-07-21 16:19:59.946114'),
(5404, 'UserAgreementSection5Text', 'en', 'Users may be redirected to third-party services through the platform. The Platform is not responsible for the actions of third-party service providers.', '2025-07-21 16:19:59.946114'),
(5405, 'UserAgreementSection5Text', 'de', 'Nutzer können über die Plattform zu Diensten Dritter weitergeleitet werden. Die Plattform ist nicht für die Handlungen von Drittanbietern verantwortlich.', '2025-07-21 16:19:59.946114'),
(5406, 'UserAgreementSection6Title', 'tr', '6. Fesih ve Hesap Kapatma', '2025-07-21 16:19:59.946114'),
(5407, 'UserAgreementSection6Title', 'en', '6. Termination and Account Closure', '2025-07-21 16:19:59.946114'),
(5408, 'UserAgreementSection6Title', 'de', '6. Kündigung und Kontoschließung', '2025-07-21 16:19:59.946114'),
(5409, 'UserAgreementSection6Text', 'tr', 'Kullanıcılar, hesaplarını diledikleri zaman kapatma hakkına sahiptir. Platform, kurallara aykırı davranan kullanıcıların hesaplarını askıya alabilir veya silebilir.', '2025-07-21 16:19:59.946114'),
(5410, 'UserAgreementSection6Text', 'en', 'Users have the right to close their accounts at any time. The Platform may suspend or delete accounts of users who violate the rules.', '2025-07-21 16:19:59.946114'),
(5411, 'UserAgreementSection6Text', 'de', 'Nutzer haben das Recht, ihre Konten jederzeit zu schließen. Die Plattform kann Konten von Nutzern, die gegen die Regeln verstoßen, sperren oder löschen.', '2025-07-21 16:19:59.946114'),
(5412, 'UserAgreementSection7Title', 'tr', '7. Sorumluluk Sınırlaması', '2025-07-21 16:19:59.946114'),
(5413, 'UserAgreementSection7Title', 'en', '7. Limitation of Liability', '2025-07-21 16:19:59.946114'),
(5414, 'UserAgreementSection7Title', 'de', '7. Haftungsbeschränkung', '2025-07-21 16:19:59.946114'),
(5415, 'UserAgreementSection7Text', 'tr', 'Platform, doğrudan veya dolaylı olarak meydana gelebilecek zararlar için sorumlu tutulamaz. Hizmetin kullanılabilirliği teknik arızalar, bakım çalışmaları veya mücbir sebepler nedeniyle kesintiye uğrayabilir.', '2025-07-21 16:19:59.946114'),
(5416, 'UserAgreementSection7Text', 'en', 'The Platform cannot be held responsible for direct or indirect damages. Service availability may be interrupted due to technical failures, maintenance work, or force majeure.', '2025-07-21 16:19:59.946114'),
