(5421, 'UserAgreementSection8Text', 'tr', 'Kullanıcılar, Platform’a ait içeriklerin izinsiz kopyalanamayacağını ve ticari amaçla kullanılamayacağını kabul eder.', '2025-07-21 16:19:59.946114'),
