(5427, 'UserAgreementSection9Text', 'tr', 'İşbu sözleşmeden doğan tüm uyuşmazlıkların çözümünde [Şirketin Bulunduğu Şehir] Mahkemeleri ve İcra Daireleri yetkilidir.', '2025-07-21 16:19:59.946114'),
