(5430, 'UserAgreementAcceptance', 'tr', 'İşbu sözleşmeyi kabul ederek, yukarıdaki tüm şartları okuduğumu, anladığımı ve kabul ettiğimi beyan ederim.', '2025-07-21 16:19:59.946114'),
