(6459, 'AboutUsDescription1', 'tr', 'Firmamız, Çalışma ve Sosyal Güvenlik Bakanlığı tarafından yetkilendirilmiş bir Ortak Sağlık ve Güvenlik Birimi (OSGB) olarak, iş dünyasına yenilikçi ve güvenilir çözümler sunmak amacıyla kurulmuştur.', '2025-07-22 02:05:32.000000'),
(6460, 'AboutUsDescription1', 'en', 'Our company, authorized by the Ministry of Labor and Social Security as a Joint Health and Safety Unit (OSGB), was established to provide innovative and reliable solutions to the business world.', '2025-07-22 02:05:32.000000'),
(6461, 'AboutUsDescription1', 'de', 'Unser Unternehmen wurde als Gemeinsame Gesundheits- und Sicherheitsstelle (OSGB) vom Ministerium für Arbeit und Soziales autorisiert und mit dem Ziel gegründet, innovative und zuverlässige Lösungen für die Geschäftswelt bereitzustellen.', '2025-07-22 02:05:32.000000'),
(6462, 'AboutUsDescription2', 'tr', 'OSGB hizmetlerini firmalarla birleştiren öncü bir kuruluş olarak, iş sağlığı ve güvenliği alanında uzmanlaşmış ekibimizle, işletmelerin ve çalışanların ihtiyaçlarını tek çatı altında buluşturuyoruz.', '2025-07-22 02:05:32.000000'),
