(6522, 'ReturnGuaranteeItem3', 'tr', 'Eksikliklerin tespiti halinde, firmamız 48 saat içinde ek destek sağlar veya ücretsiz telafi hizmeti sunar.', '2025-07-22 02:05:32.000000'),
(6523, 'ReturnGuaranteeItem3', 'en', 'Upon detection of deficiencies, our company provides additional support within 48 hours or offers free compensation services.', '2025-07-22 02:05:32.000000'),
(6524, 'ReturnGuaranteeItem3', 'de', 'Bei Feststellung von Mängeln bietet unser Unternehmen innerhalb von 48 Stunden zusätzliche Unterstützung oder kostenlose Ausgleichsleistungen an.', '2025-07-22 02:05:32.000000'),
(6525, 'CustomerRightsFeedback', 'tr', 'Müşteri Hakları ve Geri Bildirim', '2025-07-22 02:05:32.000000'),
(6526, 'CustomerRightsFeedback', 'en', 'Customer Rights and Feedback', '2025-07-22 02:05:32.000000'),
(6527, 'CustomerRightsFeedback', 'de', 'Kundenrechte und Feedback', '2025-07-22 02:05:32.000000'),
(6528, 'CustomerRightsFeedbackItem1', 'tr', 'Müşterilerimiz, hizmet sürecinde karşılaştıkları her türlü sorunu veya memnuniyetsizliği, 7/24 ulaşılabilir müşteri hizmetleri ekibimize bildirebilir.', '2025-07-22 02:05:32.000000'),
(6529, 'CustomerRightsFeedbackItem1', 'en', 'Our customers can report any issues or dissatisfaction encountered during the service process to our 24/7 accessible customer service team.', '2025-07-22 02:05:32.000000'),
(6530, 'CustomerRightsFeedbackItem1', 'de', 'Unsere Kunden können jegliche Probleme oder Unzufriedenheiten, die während des Dienstprozesses auftreten, unserem rund um die Uhr erreichbaren Kundendienstteam melden.', '2025-07-22 02:05:32.000000'),
(6531, 'CustomerRightsFeedbackItem2', 'tr', 'Geri bildirimler, en geç 2 iş günü içinde detaylı bir şekilde incelenir ve çözüm önerileri müşteriye sunulur.', '2025-07-22 02:05:32.000000'),
(6532, 'CustomerRightsFeedbackItem2', 'en', 'Feedback is thoroughly reviewed within a maximum of 2 business days, and solution proposals are presented to the customer.', '2025-07-22 02:05:32.000000'),
(6533, 'CustomerRightsFeedbackItem2', 'de', 'Rückmeldungen werden innerhalb von maximal 2 Werktagen gründlich geprüft, und Lösungsvorschläge werden dem Kunden vorgelegt.', '2025-07-22 02:05:32.000000'),
(6534, 'CustomerRightsFeedbackItem3', 'tr', 'Müşteri memnuniyeti, firmamızın öncelikli hedefidir.', '2025-07-22 02:05:32.000000'),
(6535, 'CustomerRightsFeedbackItem3', 'en', 'Customer satisfaction is our company’s top priority.', '2025-07-22 02:05:32.000000'),
(6536, 'CustomerRightsFeedbackItem3', 'de', 'Kundenzufriedenheit ist die oberste Priorität unseres Unternehmens.', '2025-07-22 02:05:32.000000'),
(6537, 'SpecialCasesContact', 'tr', 'Özel Durumlar ve İletişim', '2025-07-22 02:05:32.000000'),
(6538, 'SpecialCasesContact', 'en', 'Special Cases and Contact', '2025-07-22 02:05:32.000000'),
(6539, 'SpecialCasesContact', 'de', 'Sonderfälle und Kontakt', '2025-07-22 02:05:32.000000'),
(6540, 'SpecialCasesContactItem1', 'tr', 'Teslimat süreci, iade koşulları veya ödeme planlarıyla ilgili herhangi bir özel durumunuzu değerlendirmemiz için lütfen müşteri hizmetleri ekibimizle iletişime geçin.', '2025-07-22 02:05:32.000000'),
(6541, 'SpecialCasesContactItem1', 'en', 'Please contact our customer service team to evaluate any special circumstances related to the delivery process, return conditions, or payment plans.', '2025-07-22 02:05:32.000000'),
(6542, 'SpecialCasesContactItem1', 'de', 'Bitte kontaktieren Sie unser Kundendienstteam, um besondere Umstände im Zusammenhang mit dem Lieferprozess, Rückgabebedingungen oder Zahlungsplänen zu bewerten.', '2025-07-22 02:05:32.000000'),
(6543, 'SpecialCasesContactItem2', 'tr', 'Acil durumlarda, OSGB hizmetlerinin kesintiye uğramaması için ivedilikle müdahale edilir ve müşteriye alternatif çözümler sunulur.', '2025-07-22 02:05:32.000000'),
(6544, 'SpecialCasesContactItem2', 'en', 'In emergencies, immediate action is taken to prevent disruptions to OSGB services, and alternative solutions are offered to the customer.', '2025-07-22 02:05:32.000000'),
(6545, 'SpecialCasesContactItem2', 'de', 'In Notfällen wird sofort gehandelt, um Unterbrechungen der OSGB-Dienste zu verhindern, und dem Kunden werden alternative Lösungen angeboten.', '2025-07-22 02:05:32.000000'),
(6546, 'SpecialCasesContactItem3', 'tr', 'Detaylı bilgi, destek veya özel talepleriniz için info@ilterisg.com adresine e-posta gönderebilir ya da +90 541 710 3373 numaralı telefondan bize ulaşabilirsiniz.', '2025-07-22 02:05:32.000000'),
(6547, 'SpecialCasesContactItem3', 'en', 'For detailed information, support, or special requests, you can email info@ilterisg.com or reach us at +90 541 710 3373.', '2025-07-22 02:05:32.000000'),
(6548, 'SpecialCasesContactItem3', 'de', 'Für detaillierte Informationen, Unterstützung oder spezielle Anfragen können Sie eine E-Mail an info@ilterisg.com senden oder uns unter +90 541 710 3373 erreichen.', '2025-07-22 02:05:32.000000'),
(6549, 'PrivacyPolicyDescription1', 'tr', 'Firmamız, 6698 sayılı Kişisel Verilerin Korunması Kanunu (KVKK) uyarınca, müşterilerimizin kişisel verilerinin güvenliğini ve gizliliğini en üst düzeyde korumayı taahhüt eder.', '2025-07-22 02:05:32.000000'),
(6550, 'PrivacyPolicyDescription1', 'en', 'Our company is committed to protecting the security and privacy of our customers’ personal data to the highest degree in accordance with Law No. 6698 on the Protection of Personal Data (KVKK).', '2025-07-22 02:05:32.000000'),
(6551, 'PrivacyPolicyDescription1', 'de', 'Unser Unternehmen verpflichtet sich, die Sicherheit und Privatsphäre der persönlichen Daten unserer Kunden nach höchsten Standards gemäß Gesetz Nr. 6698 zum Schutz personenbezogener Daten (KVKK) zu schützen.', '2025-07-22 02:05:32.000000'),
(6552, 'CollectedDataPurposes', 'tr', 'Toplanan Kişisel Veriler ve Amaçları', '2025-07-22 02:05:32.000000'),
(6553, 'CollectedDataPurposes', 'en', 'Collected Personal Data and Purposes', '2025-07-22 02:05:32.000000'),
(6554, 'CollectedDataPurposes', 'de', 'Erhobene persönliche Daten und Zwecke', '2025-07-22 02:05:32.000000'),
(6555, 'CollectedDataPurposesText', 'tr', 'Kişisel verileriniz, hizmet talebiniz sırasında doldurduğunuz formlar, e-posta yazışmaları, telefon görüşmeleri, ödeme işlemleri ve iş yerinizde yapılan yerinde incelemeler yoluyla toplanmaktadır.', '2025-07-22 02:05:32.000000'),
(6556, 'CollectedDataPurposesText', 'en', 'Your personal data is collected through forms filled out during your service request, email correspondence, phone calls, payment transactions, and on-site inspections at your workplace.', '2025-07-22 02:05:32.000000'),
(6557, 'CollectedDataPurposesText', 'de', 'Ihre persönlichen Daten werden durch Formulare, die Sie während Ihrer Dienstleistungsanfrage ausfüllen, E-Mail-Korrespondenz, Telefonanrufe, Zahlungsvorgänge und Vor-Ort-Inspektionen an Ihrem Arbeitsplatz erhoben.', '2025-07-22 02:05:32.000000'),
(6558, 'CollectedDataPurpose1', 'tr', 'Hizmetlerimizin eksiksiz ve zamanında sunulabilmesi', '2025-07-22 02:05:32.000000'),
(6559, 'CollectedDataPurpose1', 'en', 'To ensure our services are provided completely and on time', '2025-07-22 02:05:32.000000'),
(6560, 'CollectedDataPurpose1', 'de', 'Um sicherzustellen, dass unsere Dienste vollständig und rechtzeitig erbracht werden', '2025-07-22 02:05:32.000000'),
(6561, 'CollectedDataPurpose2', 'tr', 'Müşteri taleplerinizin karşılanması ve hizmet süreçlerinin planlanması', '2025-07-22 02:05:32.000000'),
(6562, 'CollectedDataPurpose2', 'en', 'To meet customer requests and plan service processes', '2025-07-22 02:05:32.000000'),
(6563, 'CollectedDataPurpose2', 'de', 'Um Kundenanfragen zu erfüllen und Dienstprozesse zu planen', '2025-07-22 02:05:32.000000'),
(6564, 'CollectedDataPurpose3', 'tr', 'Müşteri memnuniyetinin ölçülmesi ve hizmet kalitesinin artırılması', '2025-07-22 02:05:32.000000'),
(6565, 'CollectedDataPurpose3', 'en', 'To measure customer satisfaction and improve service quality', '2025-07-22 02:05:32.000000'),
(6566, 'CollectedDataPurpose3', 'de', 'Um Kundenzufriedenheit zu messen und die Dienstqualität zu verbessern', '2025-07-22 02:05:32.000000'),
(6567, 'CollectedDataPurpose4', 'tr', 'Yasal yükümlülüklerin yerine getirilmesi', '2025-07-22 02:05:32.000000'),
(6568, 'CollectedDataPurpose4', 'en', 'To fulfill legal obligations', '2025-07-22 02:05:32.000000'),
(6569, 'CollectedDataPurpose4', 'de', 'Um gesetzliche Verpflichtungen zu erfüllen', '2025-07-22 02:05:32.000000'),
(6570, 'CollectedDataPurpose5', 'tr', 'Gerektiğinde sizinle iletişim kurulması ve bilgilendirme yapılması', '2025-07-22 02:05:32.000000'),
(6571, 'CollectedDataPurpose5', 'en', 'To communicate with you and provide information when necessary', '2025-07-22 02:05:32.000000'),
(6572, 'CollectedDataPurpose5', 'de', 'Um bei Bedarf mit Ihnen zu kommunizieren und Informationen bereitzustellen', '2025-07-22 02:05:32.000000'),
