INSERT IGNORE INTO`languageresources` (`Id`, `ResourceKey`, `LanguageCode`, `Value`, `LastUpdated`) VALUES
(6578, 'InvalidFileType', 'de', 'Nur JPG- oder PNG-Dateien können hochgeladen werden.', '2025-07-30 10:51:07.130482'),
(6579, 'ProfilePhotoUploaded', 'tr', 'Profil fotoğrafı başarıyla yüklendi.', '2025-07-30 10:51:07.130482'),
(6580, 'ProfilePhotoUploaded', 'en', 'Profile photo successfully uploaded.', '2025-07-30 10:51:07.130482'),
(6581, 'ProfilePhotoUploaded', 'de', 'Profilfoto erfolgreich hochgeladen.', '2025-07-30 10:51:07.130482'),
(6582, 'ErrorUploadingPhoto', 'tr', 'Fotoğraf yüklenirken bir hata oluştu.', '2025-07-30 10:51:07.130482'),
(6583, 'ErrorUploadingPhoto', 'en', 'An error occurred while uploading the photo.', '2025-07-30 10:51:07.130482'),
(6584, 'ErrorUploadingPhoto', 'de', 'Beim Hochladen des Fotos ist ein Fehler aufgetreten.', '2025-07-30 10:51:07.130482'),
(6585, 'DataSecurityMeasuresIntro', 'tr', 'Firmamız, kişisel verilerinizin güvenliğini sağlamak için en güncel teknolojik ve fiziksel önlemleri almaktadır:', '2025-07-22 02:05:32.000000'),
(6586, 'DataSecurityMeasuresIntro', 'en', 'Our company takes the latest technological and physical measures to ensure the security of your personal data:', '2025-07-22 02:05:32.000000'),
(6587, 'DataSecurityMeasuresIntro', 'de', 'Unser Unternehmen trifft die neuesten technologischen und physischen Maßnahmen, um die Sicherheit Ihrer persönlichen Daten zu gewährleisten:', '2025-07-22 02:05:32.000000'),
(6588, 'UploadPhoto', 'tr', 'Fotoğraf Yükle', '2025-07-30 11:27:58.062602'),
(6589, 'UploadPhoto', 'en', 'Upload Photo', '2025-07-30 11:27:58.062602'),
(6590, 'UploadPhoto', 'de', 'Foto hochladen', '2025-07-30 11:27:58.062602'),
(6591, 'DataSecurityMeasure2', 'tr', 'Fiziksel belgeler, kilitli dolaplarda ve güvenli arşiv odalarında saklanmakta; bu alanlara giriş-çıkışlar sıkı bir şekilde denetlenmektedir.', '2025-07-22 02:05:32.000000'),
(6592, 'DataSecurityMeasure2', 'en', 'Physical documents are stored in locked cabinets and secure archive rooms, with strict monitoring of access and exits.', '2025-07-22 02:05:32.000000'),
(6593, 'DataSecurityMeasure2', 'de', 'Physische Dokumente werden in verschlossenen Schränken und sicheren Archivräumen aufbewahrt, wobei der Zugang und die Ausgänge streng überwacht werden.', '2025-07-22 02:05:32.000000'),
(6594, 'DataSecurityMeasure3', 'tr', 'Veri tabanlarımız, yetkisiz erişimlere karşı sürekli izlenmekte ve güvenlik duvarları ile korunmaktadır.', '2025-07-22 02:05:32.000000'),
(6595, 'DataSecurityMeasure3', 'en', 'Our databases are continuously monitored against unauthorized access and protected by firewalls.', '2025-07-22 02:05:32.000000'),
(6596, 'DataSecurityMeasure3', 'de', 'Unsere Datenbanken werden kontinuierlich auf unbefugten Zugriff überwacht und durch Firewalls geschützt.', '2025-07-22 02:05:32.000000'),
(6597, 'DataSecurityMeasure4', 'tr', 'Olası veri ihlallerine karşı acil durum planlarımız mevcut olup, böyle bir durumda KVKK uyarınca 72 saat içinde sizi ve ilgili mercileri bilgilendirme taahhüdümüz bulunmaktadır.', '2025-07-22 02:05:32.000000'),
(6598, 'DataSecurityMeasure4', 'en', 'We have emergency plans in place for potential data breaches, and in such cases, we are committed to notifying you and the relevant authorities within 72 hours as per KVKK regulations.', '2025-07-22 02:05:32.000000'),
(6599, 'DataSecurityMeasure4', 'de', 'Wir haben Notfallpläne für mögliche Datenverletzungen vorhanden, und in solchen Fällen verpflichten wir uns, Sie und die zuständigen Behörden gemäß KVKK-Vorschriften innerhalb von 72 Stunden zu informieren.', '2025-07-22 02:05:32.000000'),
(6600, 'DataSecurityMeasure5', 'tr', 'Personelimiz, gizlilik politikalarımız ve KVKK kapsamında düzenli olarak eğitilmekte ve veri güvenliği konusunda bilinçlendirilmektedir.', '2025-07-22 02:05:32.000000'),
(6601, 'DataSecurityMeasure5', 'en', 'Our staff is regularly trained on our privacy policies and KVKK regulations, and they are made aware of data security.', '2025-07-22 02:05:32.000000'),
(6602, 'DataSecurityMeasure5', 'de', 'Unser Personal wird regelmäßig in unseren Datenschutzrichtlinien und KVKK-Vorschriften geschult und über Datensicherheit sensibilisiert.', '2025-07-22 02:05:32.000000'),
(6603, 'DataSecurityDesign', 'tr', 'Bu önlemler, verilerinizin kaybolması, çalınması veya yetkisiz kişilerce kullanılması riskini en aza indirmek için tasarlanmıştır.', '2025-07-22 02:05:32.000000'),
(6604, 'DataSecurityDesign', 'en', 'These measures are designed to minimize the risk of your data being lost, stolen, or used by unauthorized individuals.', '2025-07-22 02:05:32.000000'),
(6605, 'DataSecurityDesign', 'de', 'Diese Maßnahmen sind darauf ausgelegt, das Risiko eines Verlusts, Diebstahls oder einer Nutzung Ihrer Daten durch unbefugte Personen zu minimieren.', '2025-07-22 02:05:32.000000'),
(6606, 'ChangePhoto', 'tr', 'Değiştir', '2025-07-30 12:48:44.626291'),
(6607, 'ChangePhoto', 'en', 'Change', '2025-07-30 12:48:44.626291'),
(6608, 'ChangePhoto', 'de', 'Ändern', '2025-07-30 12:48:44.626291'),
(6609, 'ErrorFetchingPhoto', 'tr', 'Profil fotoğrafı alınırken bir hata oluştu.', '2025-07-30 12:48:44.626291'),
(6610, 'ErrorFetchingPhoto', 'en', 'An error occurred while fetching the profile photo.', '2025-07-30 12:48:44.626291'),
(6611, 'ErrorFetchingPhoto', 'de', 'Beim Abrufen des Profilfotos ist ein Fehler aufgetreten.', '2025-07-30 12:48:44.626291'),
(6612, 'DataSharingException1', 'tr', 'Hukuki yükümlülüklerin yerine getirilmesi için resmi makamlarla (örneğin, mahkeme kararı veya Bakanlık talebi)', '2025-07-22 02:05:32.000000'),
(6613, 'DataSharingException1', 'en', 'With official authorities for fulfilling legal obligations (e.g., court order or ministry request)', '2025-07-22 02:05:32.000000'),
(6614, 'DataSharingException1', 'de', 'Mit offiziellen Behörden zur Erfüllung gesetzlicher Verpflichtungen (z. B. Gerichtsbeschluss oder Ministeriumsanfrage)', '2025-07-22 02:05:32.000000'),
(6615, 'DataSharingException2', 'tr', 'Hizmetin bir kısmının yürütülmesi için iş birliği yapılan OSGB uzmanlarıyla (bu durumda, uzmanlar da KVKK’ya uygun gizlilik sözleşmeleri ile bağlıdır)', '2025-07-22 02:05:32.000000'),
(6616, 'DataSharingException2', 'en', 'With OSGB experts collaborating on a part of the service (in which case, the experts are also bound by KVKK-compliant confidentiality agreements)', '2025-07-22 02:05:32.000000'),
(6617, 'DataSharingException2', 'de', 'Mit OSGB-Experten, die an einem Teil des Dienstes mitwirken (in diesem Fall sind die Experten auch an KVKK-konforme Vertraulichkeitsvereinbarungen gebunden)', '2025-07-22 02:05:32.000000'),
(6618, 'DataSharingRestriction', 'tr', 'Üçüncü taraflarla veri paylaşımı gerektiğinde, yalnızca gerekli minimum veri aktarılır ve bu tarafların da aynı güvenlik standartlarına uyması zorunlu kılınır.', '2025-07-22 02:05:32.000000'),
(6619, 'DataSharingRestriction', 'en', 'When data sharing with third parties is necessary, only the minimum required data is transferred, and these parties are required to adhere to the same security standards.', '2025-07-22 02:05:32.000000'),
(6620, 'DataSharingRestriction', 'de', 'Wenn eine Datenweitergabe an Dritte erforderlich ist, werden nur die minimal erforderlichen Daten übertragen, und diese Parteien sind verpflichtet, den gleichen Sicherheitsstandards zu entsprechen.', '2025-07-22 02:05:32.000000'),
(6621, 'DataRetentionPeriod', 'tr', 'Veri Saklama Süresi', '2025-07-22 02:05:32.000000'),
(6622, 'DataRetentionPeriod', 'en', 'Data Retention Period', '2025-07-22 02:05:32.000000'),
(6623, 'DataRetentionPeriod', 'de', 'Datenaufbewahrungsfrist', '2025-07-22 02:05:32.000000'),
(6624, 'DataRetentionPeriodText', 'tr', 'Kişisel verileriniz, hizmetin sunulduğu süre boyunca ve yasal saklama süreleri dikkate alınarak muhafaza edilir.', '2025-07-22 02:05:32.000000'),
(6625, 'DataRetentionPeriodText', 'en', 'Your personal data is retained for the duration of the service and in accordance with legal retention periods.', '2025-07-22 02:05:32.000000'),
(6626, 'DataRetentionPeriodText', 'de', 'Ihre persönlichen Daten werden für die Dauer des Dienstes und gemäß den gesetzlichen Aufbewahrungsfristen aufbewahrt.', '2025-07-22 02:05:32.000000'),
(6627, 'YourRightsKVKK', 'tr', 'KVKK Kapsamındaki Haklarınız', '2025-07-22 02:05:32.000000'),
(6628, 'YourRightsKVKK', 'en', 'Your Rights Under KVKK', '2025-07-22 02:05:32.000000'),
(6629, 'YourRightsKVKK', 'de', 'Ihre Rechte gemäß KVKK', '2025-07-22 02:05:32.000000'),
(6630, 'YourRightsKVKKIntro', 'tr', '6698 sayılı Kanun uyarınca, kişisel verilerinizle ilgili aşağıdaki haklara sahipsiniz:', '2025-07-22 02:05:32.000000'),
(6631, 'YourRightsKVKKIntro', 'en', 'Under Law No. 6698, you have the following rights regarding your personal data:', '2025-07-22 02:05:32.000000'),
(6632, 'YourRightsKVKKIntro', 'de', 'Gemäß Gesetz Nr. 6698 haben Sie die folgenden Rechte in Bezug auf Ihre persönlichen Daten:', '2025-07-22 02:05:32.000000'),
(6633, 'YourRight1', 'tr', 'Verilerinizin işlenip işlenmediğini öğrenme', '2025-07-22 02:05:32.000000'),
(6634, 'YourRight1', 'en', 'To learn whether your data is being processed', '2025-07-22 02:05:32.000000'),
(6635, 'YourRight1', 'de', 'Zu erfahren, ob Ihre Daten verarbeitet werden', '2025-07-22 02:05:32.000000'),
(6636, 'YourRight2', 'tr', 'İşlenmişse buna ilişkin bilgi talep etme', '2025-07-22 02:05:32.000000'),
(6637, 'YourRight2', 'en', 'To request information if your data has been processed', '2025-07-22 02:05:32.000000'),
(6638, 'YourRight2', 'de', 'Informationen anzufordern, wenn Ihre Daten verarbeitet wurden', '2025-07-22 02:05:32.000000'),
(6639, 'YourRight3', 'tr', 'Verilerinizin işlenme amacını ve bu amaca uygun kullanılıp kullanılmadığını öğrenme', '2025-07-22 02:05:32.000000'),
(6640, 'YourRight3', 'en', 'To learn the purpose of the processing of your data and whether it is used in accordance with that purpose', '2025-07-22 02:05:32.000000'),
(6641, 'YourRight3', 'de', 'Zu erfahren, welchem Zweck die Verarbeitung Ihrer Daten dient und ob sie diesem Zweck entsprechend genutzt wird', '2025-07-22 02:05:32.000000'),
(6642, 'YourRight4', 'tr', 'Verilerinizin aktarıldığı üçüncü kişileri bilme', '2025-07-22 02:05:32.000000'),
(6643, 'YourRight4', 'en', 'To know the third parties to whom your data has been transferred', '2025-07-22 02:05:32.000000'),
(6644, 'YourRight4', 'de', 'Die Dritten zu kennen, an die Ihre Daten übermittelt wurden', '2025-07-22 02:05:32.000000'),
(6645, 'YourRight5', 'tr', 'Eksik veya yanlış işlenmiş verilerin düzeltilmesini isteme', '2025-07-22 02:05:32.000000'),
(6646, 'YourRight5', 'en', 'To request the correction of incomplete or inaccurately processed data', '2025-07-22 02:05:32.000000'),
(6647, 'YourRight5', 'de', 'Die Korrektur unvollständiger oder unrichtig verarbeiteter Daten zu verlangen', '2025-07-22 02:05:32.000000'),
(6648, 'YourRight6', 'tr', 'İşlenen verilerin otomatik sistemlerle analiz edilmesi durumunda aleyhinize bir sonucun ortaya çıkmasına itiraz etme', '2025-07-22 02:05:32.000000'),
(6649, 'YourRight6', 'en', 'To object to the emergence of a result against you in case your processed data is analyzed with automated systems', '2025-07-22 02:05:32.000000'),
(6650, 'YourRight6', 'de', 'Widerspruch einzulegen, falls bei der Analyse Ihrer verarbeiteten Daten mit automatisierten Systemen ein Ergebnis zu Ihren Ungunsten entsteht', '2025-07-22 02:05:32.000000'),
(6651, 'YourRightsContact', 'tr', 'Bu haklarınızı kullanmak için destek@ilterisg.com adresine yazılı olarak başvurabilir veya +90 541 710 3373 numaralı telefondan bizimle iletişime geçebilirsiniz.', '2025-07-22 02:05:32.000000'),
(6652, 'YourRightsContact', 'en', 'You can exercise these rights by submitting a written application to destek@ilterisg.com or by contacting us at +90 541 710 3373.', '2025-07-22 02:05:32.000000'),
(6653, 'YourRightsContact', 'de', 'Sie können diese Rechte ausüben, indem Sie eine schriftliche Anfrage an destek@ilterisg.com senden oder uns unter +90 541 710 3373 kontaktieren.', '2025-07-22 02:05:32.000000'),
(6654, 'ContactComplaint', 'tr', 'İletişim ve Şikayet', '2025-07-22 02:05:32.000000'),
(6655, 'ContactComplaint', 'en', 'Contact and Complaint', '2025-07-22 02:05:32.000000'),
(6656, 'ContactComplaint', 'de', 'Kontakt und Beschwerde', '2025-07-22 02:05:32.000000'),
(6657, 'ContactComplaintText', 'tr', 'Kişisel verilerinizin işlenmesiyle ilgili herhangi bir sorunuz, talebiniz veya şikayetiniz olduğunda, bizimle iletişime geçmekten çekinmeyin.', '2025-07-22 02:05:32.000000'),
(6658, 'ContactComplaintText', 'en', 'Do not hesitate to contact us if you have any questions, requests, or complaints regarding the processing of your personal data.', '2025-07-22 02:05:32.000000'),
(6659, 'ContactComplaintText', 'de', 'Zögern Sie nicht, uns zu kontaktieren, wenn Sie Fragen, Anfragen oder Beschwerden bezüglich der Verarbeitung Ihrer persönlichen Daten haben.', '2025-07-22 02:05:32.000000'),
(6660, 'PreviousFormDataLoaded', 'tr', 'Bu form, daha önce doldurulmuş bir EK-2 formundan alınan bilgilerle otomatik olarak doldurulmuştur. Lütfen bilgileri kontrol edin ve gerekirse güncelleyin.', '2025-07-30 13:59:05.399474'),
(6661, 'PreviousFormDataLoaded', 'en', 'This form has been automatically filled with information from a previously completed EK-2 form. Please review the information and update if necessary.', '2025-07-30 13:59:05.399474'),
(6662, 'PreviousFormDataLoaded', 'de', 'Dieses Formular wurde automatisch mit Informationen aus einem zuvor ausgefüllten EK-2-Formular ausgefüllt. Bitte überprüfen Sie die Informationen und aktualisieren Sie sie bei Bedarf.', '2025-07-30 13:59:05.399474'),
