(6699, 'SubjectDescription', 'tr', 'İşbu Sözleşme’nin konusu, Alıcı’nın Satıcı’ya ait www.ilterisg.com web sitesi üzerinden satın aldığı Ortak Sağlık ve Güvenlik Birimi (OSGB) hizmetlerinin nitelikleri, ücreti, ödeme şekli, teslimat koşulları, cayma hakkı, iade ve iptal prosedürlerini düzenlemektir.', '2025-07-22 02:05:32.000000'),
(6700, 'SubjectDescription', 'en', 'The subject of this Contract is to regulate the qualities, fees, payment methods, delivery conditions, right of withdrawal, return, and cancellation procedures of the OSGB (Joint Health and Safety Unit) services purchased by the Buyer through the Seller’s www.ilterisg.com website.', '2025-07-22 02:05:32.000000'),
(6701, 'SubjectDescription', 'de', 'Der Gegenstand dieses Vertrags ist die Regelung der Qualitäten, Gebühren, Zahlungsmethoden, Lieferbedingungen, des Widerrufsrechts, der Rückgabe- und Stornierungsverfahren der OSGB-Dienste (Gemeinsame Gesundheits- und Sicherheitsstelle), die der Käufer über die Website www.ilterisg.com des Verkäufers kauft.', '2025-07-22 02:05:32.000000'),
