(6726, 'InvoiceInfoText', 'tr', 'Hizmet bedeli faturası, ödeme tamamlandıktan sonra Alıcı’nın belirttiği adrese veya e-posta adresine gönderilir.', '2025-07-22 02:05:32.000000'),
