(6729, 'PriceInfo', 'tr', 'Ücret, satın alma işlemi sırasında Alıcı’ya açıkça bildirilir ve tüm vergiler dahil edilerek toplam tutar olarak sunulur.', '2025-07-22 02:05:32.000000'),
(6730, 'PriceInfo', 'en', 'The fee is clearly notified to the Buyer during the purchase process and presented as the total amount including all taxes.', '2025-07-22 02:05:32.000000'),
(6731, 'PriceInfo', 'de', 'Die Gebühr wird dem Käufer während des Kaufprozesses klar mitgeteilt und als Gesamtbetrag unter Einbeziehung aller Steuern präsentiert.', '2025-07-22 02:05:32.000000'),
