(6735, 'DeliveryConditionsText', 'tr', 'Satıcı, hizmetin teslimatını, ödeme onaylandıktan ve Sözleşme kurulduktan sonra en geç 5 (beş) iş günü içinde başlatır.', '2025-07-22 02:05:32.000000'),
(6736, 'DeliveryConditionsText', 'en', 'The Seller initiates the service delivery within a maximum of 5 (five) business days after payment approval and contract establishment.', '2025-07-22 02:05:32.000000'),
(6737, 'DeliveryConditionsText', 'de', 'Der Verkäufer beginnt die Dienstleistungslieferung innerhalb von maximal 5 (fünf) Werktagen nach Zahlungsbestätigung und Vertragsabschluss.', '2025-07-22 02:05:32.000000'),
(6738, 'DeliveryCondition1', 'tr', 'Hizmet başlangıç tarihi ve takvimi, Alıcı’ya e-posta veya telefon yoluyla bildirilir.', '2025-07-22 02:05:32.000000'),
(6739, 'DeliveryCondition1', 'en', 'The service start date and schedule are notified to the Buyer via email or phone.', '2025-07-22 02:05:32.000000'),
(6740, 'DeliveryCondition1', 'de', 'Das Startdatum und der Zeitplan des Dienstes werden dem Käufer per E-Mail oder Telefon mitgeteilt.', '2025-07-22 02:05:32.000000'),
(6741, 'DeliveryCondition2', 'tr', 'Olası gecikmelerde, Satıcı 24 saat içinde Alıcı’yı bilgilendirir ve alternatif çözümler sunar.', '2025-07-22 02:05:32.000000'),
(6742, 'DeliveryCondition2', 'en', 'In case of possible delays, the Seller informs the Buyer within 24 hours and offers alternative solutions.', '2025-07-22 02:05:32.000000'),
(6743, 'DeliveryCondition2', 'de', 'Falls es zu möglichen Verzögerungen kommt, informiert der Verkäufer den Käufer innerhalb von 24 Stunden und bietet alternative Lösungen an.', '2025-07-22 02:05:32.000000'),
(6744, 'DeliveryCondition3', 'tr', 'Hizmetin kesintisiz devam etmesi için Satıcı, gerekli personel ve teknik altyapıyı sağlar.', '2025-07-22 02:05:32.000000'),
(6745, 'DeliveryCondition3', 'en', 'The Seller provides the necessary personnel and technical infrastructure to ensure uninterrupted service continuation.', '2025-07-22 02:05:32.000000'),
(6746, 'DeliveryCondition3', 'de', 'Der Verkäufer stellt das notwendige Personal und die technische Infrastruktur bereit, um einen unterbrechungsfreien Dienstfortbestand zu gewährleisten.', '2025-07-22 02:05:32.000000'),
(6747, 'RightOfWithdrawal', 'tr', 'Cayma Hakkı', '2025-07-22 02:05:32.000000'),
