(6750, 'RightOfWithdrawalText', 'tr', 'Alıcı, hizmetin niteliği gereği cayma hakkını, hizmetin başlamasından önceki 14 (ondört) gün içinde kullanabilir.', '2025-07-22 02:05:32.000000'),
(6751, 'RightOfWithdrawalText', 'en', 'The Buyer may exercise the right of withdrawal within 14 (fourteen) days before the service starts, due to the nature of the service.', '2025-07-22 02:05:32.000000'),
(6752, 'RightOfWithdrawalText', 'de', 'Der Käufer kann das Widerrufsrecht aufgrund der Art des Dienstes innerhalb von 14 (vierzehn) Tagen vor Beginn des Dienstes ausüben.', '2025-07-22 02:05:32.000000'),
(6753, 'RightOfWithdrawalItem1', 'tr', 'Alıcı, cayma talebini yazılı olarak (e-posta veya iadeli taahhütlü mektup ile) Satıcı’ya bildirir.', '2025-07-22 02:05:32.000000'),
(6754, 'RightOfWithdrawalItem1', 'en', 'The Buyer notifies the Seller of the withdrawal request in writing (via email or registered letter).', '2025-07-22 02:05:32.000000'),
(6755, 'RightOfWithdrawalItem1', 'de', 'Der Käufer teilt dem Verkäufer den Widerrufsantrag schriftlich (per E-Mail oder Einschreiben) mit.', '2025-07-22 02:05:32.000000'),
(6756, 'RightOfWithdrawalItem2', 'tr', 'Cayma bildiriminden itibaren 10 (on) iş günü içinde ödenen bedel, Alıcı’ya kesintisiz olarak iade edilir.', '2025-07-22 02:05:32.000000'),
(6757, 'RightOfWithdrawalItem2', 'en', 'The paid amount is refunded to the Buyer without interruption within 10 (ten) business days from the withdrawal notification.', '2025-07-22 02:05:32.000000'),
(6758, 'RightOfWithdrawalItem2', 'de', 'Der gezahlte Betrag wird dem Käufer innerhalb von 10 (zehn) Werktagen ab der Widerrufsmitteilung ohne Unterbrechung erstattet.', '2025-07-22 02:05:32.000000'),
(6759, 'RightOfWithdrawalItem3', 'tr', 'Hizmetin başlamasından sonra cayma hakkı kullanılamaz; bu durumda iade ve iptal koşulları geçerlidir.', '2025-07-22 02:05:32.000000'),
(6760, 'RightOfWithdrawalItem3', 'en', 'The right of withdrawal cannot be exercised after the service has started; in this case, return and cancellation conditions apply.', '2025-07-22 02:05:32.000000'),
(6761, 'RightOfWithdrawalItem3', 'de', 'Das Widerrufsrecht kann nach Beginn des Dienstes nicht ausgeübt werden; in diesem Fall gelten Rückgabe- und Stornierungsbedingungen.', '2025-07-22 02:05:32.000000'),
(6762, 'RightOfWithdrawalNote', 'tr', 'Cayma hakkı, Alıcı’nın açık rızasıyla hizmetin erken başlaması durumunda geçersiz hale gelebilir.', '2025-07-22 02:05:32.000000'),
(6763, 'RightOfWithdrawalNote', 'en', 'The right of withdrawal may become invalid if the Buyer explicitly consents to the early start of the service.', '2025-07-22 02:05:32.000000'),
(6764, 'RightOfWithdrawalNote', 'de', 'Das Widerrufsrecht kann ungültig werden, wenn der Käufer ausdrücklich der vorzeitigen Inbetriebnahme des Dienstes zustimmt.', '2025-07-22 02:05:32.000000'),
