(6773, 'ReturnCancellationItem1', 'de', 'Der Käufer benachrichtigt den Verkäufer unter Vorlage von Unterlagen.', '2025-07-22 02:05:32.000000'),
(6774, 'ReturnCancellationItem2', 'tr', 'Satıcı, 48 saat içinde eksikliği giderir veya telafi hizmeti sunar.', '2025-07-22 02:05:32.000000'),
(6775, 'ReturnCancellationItem2', 'en', 'The Seller addresses the deficiency within 48 hours or provides compensation services.', '2025-07-22 02:05:32.000000'),
(6776, 'ReturnCancellationItem2', 'de', 'Der Verkäufer behebt den Mangel innerhalb von 48 Stunden oder bietet Ausgleichsleistungen an.', '2025-07-22 02:05:32.000000'),
(6777, 'ReturnCancellationItem3', 'tr', 'Eksiklik giderilemezse, ödenen bedelin tamamı veya eksik kalan kısma karşılık gelen tutar 7 iş günü içinde iade edilir.', '2025-07-22 02:05:32.000000'),
(6778, 'ReturnCancellationItem3', 'en', 'If the deficiency cannot be resolved, the full paid amount or the amount corresponding to the deficiency is refunded within 7 business days.', '2025-07-22 02:05:32.000000'),
(6779, 'ReturnCancellationItem3', 'de', 'Kann der Mangel nicht behoben werden, wird der volle gezahlte Betrag oder der Betrag, der dem Mangel entspricht, innerhalb von 7 Werktagen erstattet.', '2025-07-22 02:05:32.000000'),
