(6810, 'DisputeResolutionText', 'tr', 'Sözleşme’den kaynaklanan uyuşmazlıklarda, öncelikle taraflar iyi niyetle çözüm arar. Çözüm sağlanamazsa, Alıcı’nın ikametgahında bulunan Tüketici Hakem Heyeti veya Tüketici Mahkemeleri yetkilidir.', '2025-07-22 02:05:32.000000'),
