(21631, 'ManageOHSProcesses', 'tr', 'İşletmenizin iş sağlığı ve güvenliği süreçlerini profesyonel bir şekilde yönetin. İSG danışmanlığı, risk analizi, sağlık taramaları ve yasal uyumluluk hizmetlerimizle iş yerinizi güvenli hale getirin.', '2025-08-03 13:34:31.423645'),
