(21646, 'SafeLegalSolutionsDesc', 'tr', 'Tüm İSG süreçlerinizi tek noktadan yönetin, iş sağlığı ve güvenliğiyle ilgili tüm yasal gereklilikleri kolayca yerine getirin. OSGB hizmetlerimizle çalışanlarınızı koruyun, iş yerinizi denetimlere hazır hale getirin.', '2025-08-03 13:34:31.423645'),
(21647, 'SafeLegalSolutionsDesc', 'en', 'Manage all your OHS processes from a single point, easily meet all legal requirements related to occupational health and safety. Protect your employees with our OSGB services and prepare your workplace for inspections.', '2025-08-03 13:34:31.423645'),
(21648, 'SafeLegalSolutionsDesc', 'de', 'Verwalten Sie alle Ihre Arbeitsschutzprozesse von einem einzigen Ort aus und erfüllen Sie mühelos alle gesetzlichen Anforderungen im Zusammenhang mit Arbeitsschutz und Sicherheit. Schützen Sie Ihre Mitarbeiter mit unseren OSGB-Diensten und bereiten Sie Ihren Arbeitsplatz auf Inspektionen vor.', '2025-08-03 13:34:31.423645'),
(21649, 'TrustPeace', 'tr', 'Güven ve Huzur', '2025-08-03 13:34:31.423645'),
