(21655, 'EasyOHSManagementDesc', 'tr', 'İSG hizmetlerinizi online yönetin, saha operasyonlarınızı hızlandırın. Anlaşma, raporlama, eğitim süreçleri ve sağlık muayenelerini tek platformdan takip edin', '2025-08-03 13:34:31.423645'),
(21656, 'EasyOHSManagementDesc', 'en', 'Manage your OHS services online and accelerate your field operations. Track agreements, reporting, training processes, and health checks from a single platform.', '2025-08-03 13:34:31.423645'),
(21657, 'EasyOHSManagementDesc', 'de', 'Verwalten Sie Ihre Arbeitsschutzdienste online und beschleunigen Sie Ihre Feldeinsätze. Verfolgen Sie Vereinbarungen, Berichterstattung, Schulungsprozesse und Gesundheitsuntersuchungen von einer einzigen Plattform aus.', '2025-08-03 13:34:31.423645'),
(21658, 'ComfortConvenience', 'tr', 'Konfor ve Kolaylık', '2025-08-03 13:34:31.423645'),
(21659, 'ComfortConvenience', 'en', 'Comfort and Convenience', '2025-08-03 13:34:31.423645'),
(21660, 'ComfortConvenience', 'de', 'Komfort und Bequemlichkeit', '2025-08-03 13:34:31.423645'),
(21661, 'TimeResourceSaving', 'tr', 'Zamandan ve Kaynaktan Tasarruf', '2025-08-03 13:34:31.423645'),
(21662, 'TimeResourceSaving', 'en', 'Time and Resource Saving', '2025-08-03 13:34:31.423645'),
(21663, 'TimeResourceSaving', 'de', 'Zeit- und Ressourcenersparnis', '2025-08-03 13:34:31.423645'),
(21826, 'AboutUs', 'tr', 'Hakkımızda', '2025-08-03 13:45:19.295520'),
(21827, 'AboutUs', 'en', 'About Us', '2025-08-03 13:45:19.295520'),
(21828, 'AboutUs', 'de', 'Über Uns', '2025-08-03 13:45:19.295520'),
(21829, 'AboutUsDescription2', 'en', 'Our mission is to create a healthy and safe working environment in workplaces, supporting businesses in fully meeting their legal obligations. Since our establishment, we have earned our customers’ trust through services in areas such as risk assessments, comprehensive occupational health and safety training, environmental measurements, emergency planning, periodic health screenings, and more. By ensuring full compliance with regulations, we enable businesses to prioritize not only their legal obligations but also the health and well-being of their employees.', '2025-08-03 13:45:19.295520'),
(21830, 'AboutUsDescription2', 'de', 'Unsere Mission ist es, in Arbeitsstätten eine gesunde und sichere Arbeitsumgebung zu schaffen und Unternehmen dabei zu unterstützen, ihre gesetzlichen Verpflichtungen vollständig zu erfüllen. Seit unserer Gründung haben wir das Vertrauen unserer Kunden durch Dienstleistungen in Bereichen wie Risikobewertungen, umfassende Schulungen zu Arbeitsschutz und -sicherheit, Umweltmessungen, Notfallplanung, regelmäßige Gesundheitsuntersuchungen und mehr gewonnen. Durch vollständige Einhaltung der Vorschriften ermöglichen wir Unternehmen, nicht nur ihre gesetzlichen Verpflichtungen, sondern auch die Gesundheit und das Wohlbefinden ihrer Mitarbeiter in den Vordergrund zu stellen.', '2025-08-03 13:45:19.295520'),
(21831, 'AboutUsDescription3', 'tr', 'Biz, OSGB hizmetlerini bir adım öteye taşıyarak firmalarla iş birliği yapan bir köprü olmayı hedefliyoruz. Her bir müşterimizin ihtiyaçlarına özel çözümler üretiyor, iş süreçlerini kolaylaştırıyor ve sürdürülebilir bir güvenlik kültürü inşa ediyoruz. Çalışan sağlığı ve müşteri memnuniyeti, faaliyetlerimizin temel taşlarıdır. Bu bilinçle, teknolojinin sunduğu en güncel imkanları kullanarak, yenilikçi yaklaşımlar geliştiriyor ve sektörde öncü bir rol üstleniyoruz.', '2025-08-03 13:45:19.295520'),
(21832, 'AboutUsDescription3', 'en', 'We aim to take OSGB services a step further by acting as a bridge collaborating with companies. We provide tailored solutions for each customer’s needs, streamline business processes, and build a sustainable safety culture. Employee health and customer satisfaction are the cornerstones of our operations. With this awareness, we leverage the latest technological opportunities to develop innovative approaches and take a leading role in the industry.', '2025-08-03 13:45:19.295520'),
(21833, 'AboutUsDescription3', 'de', 'Wir streben danach, OSGB-Dienstleistungen einen Schritt weiter zu bringen, indem wir als Brücke in Zusammenarbeit mit Unternehmen agieren. Wir bieten maßgeschneiderte Lösungen für die Bedürfnisse jedes Kunden, optimieren Geschäftsprozesse und schaffen eine nachhaltige Sicherheitskultur. Die Gesundheit der Mitarbeiter und die Kundenzufriedenheit sind die Eckpfeiler unserer Tätigkeiten. Mit diesem Bewusstsein nutzen wir die neuesten technologischen Möglichkeiten, um innovative Ansätze zu entwickeln und eine führende Rolle in der Branche zu übernehmen.', '2025-08-03 13:45:19.295520'),
(21834, 'AboutUsDescription4', 'tr', 'Firmamız, sizinle birlikte büyümeyi ve iş dünyasına değer katmayı amaçlıyor. İş sağlığı ve güvenliği konusundaki tüm ihtiyaçlarınızda yanınızda olmaktan gurur duyuyor, profesyonel ekibimizle her zaman en iyisini sunmak için çalışıyoruz. Bize güvenen işletmelerle kurduğumuz güçlü bağlar, başarımızın en büyük kanıtıdır.', '2025-08-03 13:45:19.295520'),
(21835, 'AboutUsDescription4', 'en', 'Our company aims to grow with you and add value to the business world. We take pride in being by your side for all your occupational health and safety needs, always striving to offer the best with our professional team. The strong bonds we have built with the businesses that trust us are the greatest proof of our success.', '2025-08-03 13:45:19.295520'),
(21836, 'AboutUsDescription4', 'de', 'Unser Unternehmen zielt darauf ab, mit Ihnen zu wachsen und der Geschäftswelt einen Mehrwert zu bieten. Wir sind stolz darauf, Ihnen bei all Ihren Bedürfnissen im Bereich Arbeitsschutz und -sicherheit zur Seite zu stehen und streben mit unserem professionellen Team stets danach, das Beste zu bieten. Die starken Bindungen, die wir mit den Unternehmen, die uns vertrauen, aufgebaut haben, sind der größte Beweis für unseren Erfolg.', '2025-08-03 13:45:19.295520'),
(21837, 'DeliveryReturnTerms', 'tr', 'Teslimat ve İade Şartları', '2025-08-03 13:45:19.295520'),
(21838, 'DeliveryReturnTerms', 'en', 'Delivery and Return Terms', '2025-08-03 13:45:19.295520'),
(21839, 'DeliveryReturnTerms', 'de', 'Liefer- und Rückgabebedingungen', '2025-08-03 13:45:19.295520'),
(21840, 'DeliveryProcess', 'tr', 'Teslimat Süreci', '2025-08-03 13:45:19.295520'),
(21841, 'DeliveryProcess', 'en', 'Delivery Process', '2025-08-03 13:45:19.295520'),
(21842, 'DeliveryProcess', 'de', 'Lieferprozess', '2025-08-03 13:45:19.295520'),
(21843, 'DeliveryProcessItem1', 'tr', 'Firmamız, Ortak Sağlık ve Güvenlik Birimi (OSGB) hizmetlerini, müşteri ile yapılan detaylı yazılı sözleşmede belirtilen tarihler ve koşullar çerçevesinde sunar.', '2025-08-03 13:45:19.295520'),
(21844, 'DeliveryProcessItem1', 'en', 'Our company provides Common Health and Safety Unit (OSGB) services within the dates and conditions specified in the detailed written contract with the customer.', '2025-08-03 13:45:19.295520'),
(21845, 'DeliveryProcessItem1', 'de', 'Unser Unternehmen bietet Dienstleistungen der Gemeinsamen Gesundheits- und Sicherheitsstelle (OSGB) innerhalb der in dem detaillierten schriftlichen Vertrag mit dem Kunden angegebenen Termine und Bedingungen an.', '2025-08-03 13:45:19.295520'),
(21846, 'DeliveryProcessItem2', 'tr', 'Hizmetin başlangıç tarihi, ödeme onaylandıktan ve sözleşme (her iki tarafça) imzalandıktan sonra, en geç iki (2) iş günü içinde müşteriye yazılı olarak bildirilir. Ayrıca, hizmetin uygulama takvimi ve aşamaları detaylı bir şekilde paylaşılır.', '2025-08-03 13:45:19.295520'),
(21847, 'DeliveryProcessItem2', 'en', 'The service start date is communicated to the customer in writing within a maximum of two (2) business days after payment confirmation and contract signing by both parties. Additionally, the service implementation schedule and stages are shared in detail.', '2025-08-03 13:45:19.295520'),
(21848, 'DeliveryProcessItem2', 'de', 'Das Startdatum des Dienstes wird dem Kunden schriftlich innerhalb von maximal zwei (2) Werktagen nach Zahlungsbestätigung und Vertragsunterzeichnung durch beide Parteien mitgeteilt. Zusätzlich werden der Umsetzungsplan und die Phasen des Dienstes detailliert geteilt.', '2025-08-03 13:45:19.295520'),
(21849, 'DeliveryProcessItem3', 'tr', 'Ödeme, hizmetin başlamasından önce tam veya taksitli olarak yapılabilir. Ödeme planı, sözleşmede açıkça belirtilir ve müşteri onayı alınır.', '2025-08-03 13:45:19.295520'),
(21850, 'DeliveryProcessItem3', 'en', 'Payment can be made in full or in installments before the service begins. The payment plan is clearly specified in the contract and approved by the customer.', '2025-08-03 13:45:19.295520'),
(21851, 'DeliveryProcessItem3', 'de', 'Die Zahlung kann vor Beginn des Dienstes vollständig oder in Raten erfolgen. Der Zahlungsplan wird im Vertrag klar festgelegt und vom Kunden genehmigt.', '2025-08-03 13:45:19.295520'),
(21852, 'DeliveryProcessItem4', 'tr', 'Hizmet teslimatı, OSGB tarafından atanacak uzman ekiplerce, iş sağlığı ve güvenliği (İSG) projeleri kapsamında düzenli denetimler, eğitimler ve raporlamalarla gerçekleştirilir.', '2025-08-03 13:45:19.295520'),
(21853, 'DeliveryProcessItem4', 'de', 'Die Dienstleistungserbringung erfolgt durch von der OSGB beauftragte Expertenteams durch regelmäßige Inspektionen, Schulungen und Berichterstattung im Rahmen von Arbeitsschutz- und Sicherheitsprojekten (OHS).', '2025-08-03 13:45:19.295520'),
(21854, 'DeliveryProcessItem5', 'tr', 'Teslimat sürecinde, teknik aksaklıklar, personel eksikliği veya beklenmedik durumlar gibi olası gecikmeler yaşanması halinde, firmamız 24 saat içinde çözüm üretir ve müşteriyi bilgilendirir. Hizmetin kesintisiz devam etmesi için yedek planlar devreye alınır.', '2025-08-03 13:45:19.295520'),
(21855, 'DeliveryProcessItem5', 'en', 'In case of potential delays due to technical issues, staff shortages, or unforeseen circumstances during the delivery process, our company provides solutions within 24 hours and informs the customer. Backup plans are activated to ensure uninterrupted service.', '2025-08-03 13:45:19.295520'),
(21856, 'DeliveryProcessItem5', 'de', 'Im Falle möglicher Verzögerungen durch technische Probleme, Personalmangel oder unvorhergesehene Umstände während des Lieferprozesses bietet unser Unternehmen innerhalb von 24 Stunden Lösungen und informiert den Kunden. Ersatzpläne werden aktiviert, um einen unterbrechungsfreien Dienst zu gewährleisten.', '2025-08-03 13:45:19.295520'),
(21857, 'DeliveryProcessItem6', 'tr', 'Müşterinin iş yeri koşullarında değişiklik (örneğin, çalışan sayısı artışı veya yeni bir risk tespiti) olması durumunda, hizmet kapsamı ek bir ücret talep edilmeden gözden geçirilir ve güncellenir.', '2025-08-03 13:45:19.295520'),
(21858, 'DeliveryProcessItem6', 'en', 'In case of changes in the customer’s workplace conditions (e.g., an increase in the number of employees or identification of a new risk), the service scope is reviewed and updated without additional fees.', '2025-08-03 13:45:19.295520'),
(21859, 'DeliveryProcessItem6', 'de', 'Bei Änderungen der Arbeitsplatzbedingungen des Kunden (z. B. Erhöhung der Mitarbeiterzahl oder Feststellung eines neuen Risikos) wird der Dienstleistungsumfang ohne zusätzliche Gebühren überprüft und aktualisiert.', '2025-08-03 13:45:19.295520'),
(21860, 'DeliveryProcessItem7', 'tr', 'Hizmetin her aşamasında, müşteriye düzenli ilerleme raporları (aylık veya proje bazlı) sunulur. Bu raporlar, yapılan çalışmaları, tespit edilen riskleri ve çözüm önerilerini içerir.', '2025-08-03 13:45:19.295520'),
(21861, 'DeliveryProcessItem7', 'en', 'At every stage of the service, regular progress reports (monthly or project-based) are provided to the customer. These reports include the work performed, identified risks, and solution recommendations.', '2025-08-03 13:45:19.295520'),
(21862, 'DeliveryProcessItem7', 'de', 'In jeder Phase des Dienstes werden dem Kunden regelmäßige Fortschrittsberichte (monatlich oder projektbasiert) zur Verfügung gestellt. Diese Berichte enthalten die durchgeführten Arbeiten, identifizierte Risiken und Lösungsvorschläge.', '2025-08-03 13:45:19.295520'),
(21863, 'CancellationChange', 'tr', 'İptal ve Değişiklik Talepleri', '2025-08-03 13:45:19.295520'),
(21864, 'CancellationChange', 'en', 'Cancellation and Change Requests', '2025-08-03 13:45:19.295520'),
(21865, 'CancellationChange', 'de', 'Stornierungs- und Änderungsanfragen', '2025-08-03 13:45:19.295520'),
(21866, 'CancellationChangeItem1', 'tr', 'Hizmet başlamadan önce yapılacak iptal veya değişiklik talepleri, hizmetin başlangıç tarihinden en az beş (5) iş günü önce yazılı olarak (e-posta veya resmi yazı ile) firmamıza iletilmelidir.', '2025-08-03 13:45:19.295520'),
(21867, 'CancellationChangeItem1', 'en', 'Cancellation or change requests before the service begins must be communicated to our company in writing (via email or official letter) at least five (5) business days before the service start date.', '2025-08-03 13:45:19.295520'),
(21868, 'CancellationChangeItem1', 'de', 'Stornierungs- oder Änderungsanfragen vor Beginn des Dienstes müssen mindestens fünf (5) Werktage vor dem Startdatum des Dienstes schriftlich (per E-Mail oder offizielles Schreiben) an unser Unternehmen übermittelt werden.', '2025-08-03 13:45:19.295520'),
(21869, 'CancellationChangeItem2', 'tr', 'Bu süre içinde bildirilen iptal talepleri geçerli kabul edilir ve ödenen hizmet bedelinin tamamı, masrafsız olarak 7 iş günü içinde müşteriye iade edilir.', '2025-08-03 13:45:19.295520'),
(21870, 'CancellationChangeItem2', 'en', 'Cancellation requests reported within this period are considered valid, and the full service fee paid is refunded to the customer without deductions within 7 business days.', '2025-08-03 13:45:19.295520'),
(21871, 'CancellationChangeItem2', 'de', 'Stornierungsanfragen, die innerhalb dieses Zeitraums gemeldet werden, gelten als gültig, und die gezahlte Dienstleistungsgebühr wird dem Kunden innerhalb von 7 Werktagen ohne Abzüge vollständig zurückerstattet.', '2025-08-03 13:45:19.295520'),
(21872, 'CancellationChangeItem3', 'tr', 'Hizmetin başlangıç tarihinden 5 iş gününden daha kısa bir süre kala yapılan iptal talepleri değerlendirilmez ve ödenen bedel iade edilmez. Ancak, müşteri talebi doğrultusunda hizmetin kapsamı değiştirilebilir.', '2025-08-03 13:45:19.295520'),
(21873, 'CancellationChangeItem3', 'en', 'Cancellation requests made less than 5 business days before the service start date will not be considered, and the paid fee will not be refunded. However, the service scope can be modified upon the customer’s request.', '2025-08-03 13:45:19.295520'),
(21874, 'CancellationChangeItem3', 'de', 'Stornierungsanfragen, die weniger als 5 Werktage vor dem Startdatum des Dienstes gestellt werden, werden nicht berücksichtigt, und die gezahlte Gebühr wird nicht zurückerstattet. Der Dienstleistungsumfang kann jedoch auf Wunsch des Kunden geändert werden.', '2025-08-03 13:45:19.295520'),
(21875, 'CancellationChangeItem4', 'tr', 'Değişiklik talepleri (örneğin, hizmet süresinin uzatılması veya ek personel talebi) için firmamız, ek bir planlama yaparak en geç 3 iş günü içinde müşteriye geri dönüş sağlar.', '2025-08-03 13:45:19.295520'),
(21876, 'CancellationChangeItem4', 'en', 'For change requests (e.g., extending the service duration or requesting additional staff), our company will make additional planning and respond to the customer within a maximum of 3 business days.', '2025-08-03 13:45:19.295520'),
(21877, 'CancellationChangeItem4', 'de', 'Für Änderungsanfragen (z. B. Verlängerung der Dienstlaufzeit oder Anforderung zusätzlichen Personals) wird unser Unternehmen zusätzliche Planungen vornehmen und dem Kunden innerhalb von maximal 3 Werktagen antworten.', '2025-08-03 13:45:19.295520'),
(21878, 'ReturnGuarantee', 'tr', 'Hizmet İadesi ve Güvence', '2025-08-03 13:45:19.295520'),
(21879, 'ReturnGuarantee', 'en', 'Service Refund and Guarantee', '2025-08-03 13:45:19.295520'),
(21880, 'ReturnGuarantee', 'de', 'Dienstleistungsrückerstattung und Garantie', '2025-08-03 13:45:19.295520'),
(21881, 'ReturnGuaranteeItem1', 'tr', 'Hizmetin niteliği gereği, başladıktan sonra iade edilmesi mümkün değildir. Ancak, firmamızın sunduğu hizmetin eksik veya yetersiz olduğu durumlarda, müşteri bu durumu belgeleyerek firmamıza bildirebilir.', '2025-08-03 13:45:19.295520'),
(21882, 'ReturnGuaranteeItem1', 'en', 'Due to the nature of the service, a refund is not possible after it has started. However, if the service provided by our company is incomplete or inadequate, the customer can report this to our company with documentation.', '2025-08-03 13:45:19.295520'),
(21883, 'ReturnGuaranteeItem1', 'de', 'Aufgrund der Natur des Dienstes ist eine Rückerstattung nach Beginn nicht möglich. Wenn der von unserem Unternehmen erbrachte Dienst jedoch unvollständig oder unzureichend ist, kann der Kunde dies mit Dokumentation unserem Unternehmen melden.', '2025-08-03 13:45:19.295520'),
(21884, 'ReturnGuaranteeItem2', 'tr', 'Eksikliklerin tespiti halinde, firmamız 48 saat içinde ek destek sağlar veya ücretsiz telafi hizmeti sunar. Bu süreçte müşteri hiçbir ek maliyetle karşılaşmaz.', '2025-08-03 13:45:19.295520'),
(21885, 'ReturnGuaranteeItem2', 'en', 'In case deficiencies are identified, our company provides additional support or free compensatory service within 48 hours. The customer incurs no additional costs during this process.', '2025-08-03 13:45:19.295520'),
(21886, 'CollectedDataRestriction', 'tr', 'Kişisel verileriniz, yukarıda belirtilen amaçlar dışında asla kullanılmaz ve bu amaçlara uygun olmayan hiçbir işlem için işlenmez.', '2025-08-03 13:45:19.295520'),
(21887, 'CollectedDataRestriction', 'en', 'Your personal data is never used for purposes other than those specified above and is not processed for any transactions not aligned with these purposes.', '2025-08-03 13:45:19.295520'),
(21888, 'CollectedDataRestriction', 'de', 'Ihre personenbezogenen Daten werden niemals für andere als die oben genannten Zwecke verwendet und nicht für Transaktionen verarbeitet, die nicht mit diesen Zwecken übereinstimmen.', '2025-08-03 13:45:19.295520'),
(21889, 'DataCollectionMethod', 'tr', 'Verilerin Toplanma Yöntemi', '2025-08-03 13:45:19.295520'),
(21890, 'DataCollectionMethod', 'en', 'Data Collection Method', '2025-08-03 13:45:19.295520'),
(21891, 'DataCollectionMethod', 'de', 'Datenerhebungsmethode', '2025-08-03 13:45:19.295520'),
(21892, 'DataCollectionMethodText', 'tr', 'Kişisel verileriniz, hizmet talebiniz sırasında doldurduğunuz formlar, e-posta yazışmaları, telefon görüşmeleri, ödeme işlemleri ve iş yerinizde yapılan yerinde incelemeler yoluyla toplanmaktadır. Verileriniz, açık rızanıza dayalı olarak veya yasal zorunluluklar çerçevesinde işlenmektedir. Verilerinizin toplanması sırasında, hangi bilgilerin neden toplandığı size açıkça bildirilir ve isteğe bağlı alanlar için onayınız alınır.', '2025-08-03 13:45:19.295520'),
(21893, 'DataCollectionMethodText', 'en', 'Your personal data is collected through forms filled out during your service request, email correspondence, phone calls, payment transactions, and on-site inspections at your workplace. Your data is processed based on your explicit consent or within the framework of legal obligations. During data collection, you are clearly informed about which information is collected and why, and your consent is obtained for optional fields.', '2025-08-03 13:45:19.295520'),
(21894, 'DataCollectionMethodText', 'de', 'Ihre personenbezogenen Daten werden durch ausgefüllte Formulare während Ihrer Dienstleistungsanfrage, E-Mail-Korrespondenz, Telefonate, Zahlungstransaktionen und Vor-Ort-Inspektionen an Ihrem Arbeitsplatz gesammelt. Ihre Daten werden auf der Grundlage Ihrer ausdrücklichen Zustimmung oder im Rahmen gesetzlicher Verpflichtungen verarbeitet. Während der Datenerhebung werden Sie klar darüber informiert, welche Informationen warum gesammelt werden, und Ihre Zustimmung wird für optionale Felder eingeholt.', '2025-08-03 13:45:19.295520'),
(21895, 'DataSecurityMeasures', 'tr', 'Veri Güvenliği ve Koruma Önlemleri', '2025-08-03 13:45:19.295520'),
(21896, 'DataSecurityMeasures', 'en', 'Data Security and Protection Measures', '2025-08-03 13:45:19.295520'),
(21897, 'DataSecurityMeasures', 'de', 'Datensicherheits- und Schutzmaßnahmen', '2025-08-03 13:45:19.295520'),
(21898, 'DataSecurityMeasure1', 'tr', 'Elektronik ortamda toplanan veriler, gelişmiş şifreleme yöntemleri (örneğin, SSL sertifikası ve AES-256 şifreleme) ile korunmakta ve yalnızca yetkili personel tarafından erişilebilmektedir.', '2025-08-03 13:45:19.295520'),
(21899, 'DataSecurityMeasure1', 'en', 'Data collected electronically is protected with advanced encryption methods (e.g., SSL certificate and AES-256 encryption) and can only be accessed by authorized personnel.', '2025-08-03 13:45:19.295520'),
(21900, 'DataSecurityMeasure1', 'de', 'Elektronisch gesammelte Daten werden mit fortschrittlichen Verschlüsselungsmethoden (z. B. SSL-Zertifikat und AES-256-Verschlüsselung) geschützt und können nur von autorisiertem Personal eingesehen werden.', '2025-08-03 13:45:19.295520'),
(21901, 'DataSharingThirdParties', 'tr', 'Verilerin Paylaşımı ve Üçüncü Taraflarla İlişkiler', '2025-08-03 13:45:19.295520'),
(21902, 'DataSharingThirdParties', 'en', 'Data Sharing and Relations with Third Parties', '2025-08-03 13:45:19.295520'),
(21903, 'DataSharingThirdParties', 'de', 'Datenfreigabe und Beziehungen zu Dritten', '2025-08-03 13:45:19.295520'),
(21904, 'DataSharingIntro', 'tr', 'Firmamız, kişisel verilerinizi yasal zorunluluklar dışında hiçbir şekilde üçüncü kişilerle paylaşmamaktadır. Ancak, aşağıdaki istisnai durumlarda veri paylaşımı gerçekleşebilir:', '2025-08-03 13:45:19.295520'),
(21905, 'DataSharingIntro', 'en', 'Our company does not share your personal data with third parties except for legal obligations. However, data sharing may occur in the following exceptional cases:', '2025-08-03 13:45:19.295520'),
(21906, 'DataSharingIntro', 'de', 'Unser Unternehmen gibt Ihre personenbezogenen Daten außer bei gesetzlichen Verpflichtungen nicht an Dritte weiter. Eine Datenfreigabe kann jedoch in folgenden Ausnahmefällen erfolgen:', '2025-08-03 13:45:19.295520'),
(21907, 'DistanceSaleContract', 'tr', 'Mesafeli Satış Sözleşmesi', '2025-08-03 13:45:19.295520'),
(21908, 'DistanceSaleContract', 'en', 'Distance Sale Contract', '2025-08-03 13:45:19.295520'),
(21909, 'DistanceSaleContract', 'de', 'Fernverkaufsvertrag', '2025-08-03 13:45:19.295520'),
(21910, 'DistanceSaleContractDescription', 'tr', 'İşbu Mesafeli Satış Sözleşmesi (\"Sözleşme\"), aşağıda belirtilen taraflar arasında, Firmamızın web sitesi üzerinden gerçekleştirilen OSGB ve firmanız arasında online satın alma işlemleri için düzenlenmiştir. 6502 sayılı Tüketicinin Korunması Hakkında Kanun ve Mesafeli Sözleşmeler Yönetmeliği hükümlerine uygun olarak hazırlanmış olup, alıcı ve satıcının hak ve yükümlülüklerini açıkça düzenler. Sözleşme, hizmetin satın alınmasıyla birlikte taraflar arasında bağlayıcı hale gelir.', '2025-08-03 13:45:19.295520'),
(21911, 'DistanceSaleContractDescription', 'en', 'This Distance Sale Contract (\"Contract\") is drawn up between the parties specified below for online purchase transactions between our company’s website and your company for OSGB services. It is prepared in accordance with Law No. 6502 on Consumer Protection and the Distance Contracts Regulation, clearly regulating the rights and obligations of the buyer and seller. The contract becomes binding between the parties upon the purchase of the service.', '2025-08-03 13:45:19.295520'),
(21912, 'DistanceSaleContractDescription', 'de', 'Dieser Fernverkaufsvertrag („Vertrag“) wird zwischen den unten angegebenen Parteien für Online-Kauftransaktionen zwischen der Website unseres Unternehmens und Ihrem Unternehmen für OSGB-Dienste erstellt. Er wurde in Übereinstimmung mit dem Gesetz Nr. 6502 zum Verbraucherschutz und der Verordnung über Fernverträge vorbereitet und regelt klar die Rechte und Pflichten des Käufers und Verkäufers. Der Vertrag wird mit dem Kauf des Dienstes zwischen den Parteien verbindlich.', '2025-08-03 13:45:19.295520'),
