(22414, 'OurStory', 'tr', 'Vizyonumuz', '2025-08-03 14:04:43.026576'),
(22415, 'OurStory', 'en', 'Our Vision', '2025-08-03 14:04:43.026576'),
(22416, 'OurStory', 'de', 'Unsere Vision', '2025-08-03 14:04:43.026576'),
(22417, 'AboutUsStory', 'tr', 'İLTER-İSG olarak, iş sağlığı ve güvenliği (İSG) hizmetlerinizi en hızlı ve en güvenli şekilde alabilmeniz için çalışıyoruz. Firmanızın ihtiyacına en uygun OSGB (Ortak Sağlık Güvenlik Birimi) hizmetini sunuyor, yasal yükümlülüklerinizi yerine getirmenizi kolaylaştırıyoruz. Kapı kapı hizmet aramanıza gerek kalmadan, tek noktadan OSGB anlaşmaları, sağlık taramaları, eğitimler ve risk analizlerini yönetmenizi sağlıyoruz. Böylece İSG süreçlerinizi hızlandırıyor, zaman ve maliyet tasarrufu yapmanıza yardımcı oluyoruz.', '2025-08-03 14:04:43.026576'),
(22418, 'AboutUsStory', 'en', 'As ILTER-OSGB, we strive to provide you with the fastest and safest occupational health and safety (OHS) services. We offer the most suitable Common Health and Safety Unit (OSGB) services tailored to your company’s needs, making it easier for you to meet your legal obligations. Without the need to search door-to-door for services, we enable you to manage OSGB agreements, health screenings, training, and risk analyses from a single point. This accelerates your OHS processes and helps you save time and costs.', '2025-08-03 14:04:43.026576'),
(22419, 'AboutUsStory', 'de', 'Als ILTER-OSGB setzen wir uns dafür ein, Ihnen die schnellsten und sichersten Arbeitsschutz- und Sicherheitsdienste (OHS) bereitzustellen. Wir bieten die passendsten Dienstleistungen der Gemeinsamen Gesundheits- und Sicherheitsstelle (OSGB), die auf die Bedürfnisse Ihres Unternehmens zugeschnitten sind, und erleichtern Ihnen die Erfüllung Ihrer gesetzlichen Verpflichtungen. Ohne von Tür zu Tür nach Dienstleistungen suchen zu müssen, ermöglichen wir Ihnen, OSGB-Vereinbarungen, Gesundheitsuntersuchungen, Schulungen und Risikoanalysen von einem einzigen Punkt aus zu verwalten. Dies beschleunigt Ihre Arbeitsschutzprozesse und hilft Ihnen, Zeit und Kosten zu sparen.', '2025-08-03 14:04:43.026576'),
